    socialNetworks: "Social Networks",
    paragraphOne: textsEN.paragraphOne,
    paragraphTwo: textsEN.paragraphTwo,
    paragraphThree: textsEN.paragraphThree,
    paragraphFour: textsEN.paragraphFour,
